DO`STLARGA ULASHING:
Salbiy odatlardan bolalarni himoyalashning eng ishonchli usullaridan biri — muntazam nazorat va ijobiy namuna bo‘la olish jihatlaridir. Kattalarning vazifasi bolalar munosabatlariga rahbarlik qilishdan iborat. Bolada tengdoshlari bilan aloqalarni o‘rnatishga yordam beradigan elementar aloqa madaniyatini shakllantirish muhimdir:
—Qichqirmasdan va janjal qilmasdan muzokara olib borish;
—Muloyimlik bilan iltimos qilish;
—Agar kerak bo‘lsa, vazifani topshiring va kuting;
—O‘yinc
... 
 osonlashtiradi, agar kattalar qo‘llab-quvvatlasa, uning o‘yindoshlari, qarindoshlari va atrofidagi odamlar bilan qanday munosabatda bo‘lishini kuzatib boradi. Voyaga yetganlarning rahbarligi ostida bolalar ijobiy muloqotda tajribaga ega bo‘ladilar.
Bolangiz salbiy odatlarni o‘zlashtirmasligi uchun:
— Oilaviy nizolarni bolaling oldida hal qilmaslik;
— Hulq-atvoridagi kichik salbiy xususiyatga ham befarq bo‘lmaslik;
— Bola guvohi bo‘lgan va so‘zlab berayotgan hodisalarning yoshiga mos ekanligiga 
...
oladi va ularni muvaffaqiyatli hal qilish uchun bolalarning yoshini hisobga olgan holda bir qator pedagogik usullardan foydalanish tavsiya etiladi:
—To‘g‘ridan-to‘g‘ri mashg‘ulot olib borish;
—Namoyish, didaktik o‘yinlar jarayonida harakatlar bilan mashg‘ulotlar gigiyena qoidalariga rioya qilish zarurligini bolalarga muntazam ravishda eslatib turish.
Shuningdek, bolalardan harakatlarning aniq va aniq bajarilishini, to‘g‘ri ketma-ketlikdan olish kerak.
psixolog Gulbahor Yusupova tayyorladi
