Yangi, 100 000 so‘mlik pul chiqarkan…
15-yanvar kuni Oliy Majlis Senati 100000 (yuz ming) so‘mlik banknot namunasi va dizaynini ma'qulladi.
Yirik nominaldagi banknot Markaziy bank tomonidan quyidagi maqsadlarda ko‘ra muomalaga chiqarilmoqda:
- aholi uchun naqd pullar bilan hisob-kitoblarni amalga oshirishda qulayliklar yaratish;
- naqd pullarni saqlash va tashish bilan bog‘liq xarajatlarni kamaytirish;
- aholiga bankomatlar orqali xizmat ko‘rsatishda samaradorlikni oshirish;
- muomaladagi naqd pullar tarkibini optimallashtirish.
100 000 (yuz ming) so‘m qiymatdagi banknotlar joriy pul massasi doirasida chiqariladi hamda uning o‘sishiga ta'sir ko‘rsatmaydi.
Yangi nominaldagi banknotning ko‘rinishi, tasnifi va chiqarilish sanasi Markaziy bank tomonidan ommaviy axborot vositalarida e'lon qilinadi.
O‘z axborotimiz.
